import React from "react";
import "./index.scss";

import ChartSolides from "../../../../../components/charts";
import List from "./list";

const Competences = ({ data }) => {
    console.log(data);
    return (
        <div className="talents-noAuth">
            <h2>Talentos</h2>
            <p className="desc-profiler">
                Talentos são competências a serem desenvolvidas
            </p>
            <div className="box-talents">
                <ChartSolides
                    type="talentsArea"
                    talentsArea={{
                        dx1: data.dx,
                        dy1: data.dy,
                        dx2: data.dy2,
                        dy2: data.dy2
                    }}
                />
                <div className="box-right-talents">
                    <List />
                </div>
            </div>
        </div>
    );
};

export default Competences;
